import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        let date = new Date();
        let copyright_symbol = '&#x24B8';

        return (
            <div className="Footer">
                <p>{copyright_symbol} Copyright {date.getFullYear()}, Lift Weights by Michelle Duer</p>
                <p> &#x24B8;Copyright {date.getFullYear()}, Lift Weights by Michelle Duer</p>
            </div>
        );
    }
}

export default Footer;
